import React from 'react';

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center px-6 py-4 text-white bg-black border-b border-redAccent">
      <h1 className="text-2xl font-serif text-primaryRed">My Portfolio</h1>
      <ul className="flex gap-6 font-sans">
        <li><a href="#home" className="hover:text-redAccent">Home</a></li>
        <li><a href="#about" className="hover:text-redAccent">About</a></li>
        <li><a href="#projects" className="hover:text-redAccent">Projects</a></li>
        <li><a href="#resume" className="hover:text-redAccent">Resume</a></li>
        <li><a href="#contact" className="hover:text-redAccent">Contact</a></li>
      </ul>
    </nav>
  );
};

export default Navbar;
